import {useDispatch, useSelector} from 'react-redux';
import * as acctionPost from './redux/action/action';
function App() {
  const r = acctionPost.getPost.getPostSuccess([{title:'1'}]);
  useDispatch(r);
  const r1 = useSelector(state=>state.post.data);
  return (
    <div>
      nguyen quang hoang
    </div>
  );
}

export default App;
